ames select: [:each | '*Icon.gif' match: each ].	icons do: [:icon | self importIconNamed: (icon upTo: $.)] ! !!MenuIcons class methodsFor: 'import/export' stamp: 'sd 11/10/2003 00:05'!importIconNamed: aString	"self importIconNamed: 'Icons16:appearanceIcon'"		| writer image stream |	writer := GIFReadWriter on: (FileStream fileNamed: aString, '.gif').	[ image := writer nextImage]			ensure: [writer close].	stream := ReadWriteStream on: (String new).	stream nextPutAll: aString ; cr.	stream nextPutAll: (self methodStart: aString).	image storeOn: stream.	stream nextPutAll: self methodEnd.	MenuIcons class compile: stream contents classified: 'accessing - icons' notifying: nil.	^ stream contents! !!MenuIcons class methodsFor: 'import/export' stamp: 'sd 11/9/2003 23:49'!methodEnd	^ ']'! !!MenuIcons class methodsFor: 'import/export' stamp: 'sd 11/10/2003 00:04'!methodStart: aString	^'^ Icons		at: #',  aString, 		' ifAbsentPut: ['! !MenuIcons initialize!